export default function Index() {
  return (
    <WorkFrame>
      <Grid container spacing={1}>
        <Grid item xs={12} md={6} lg={4}>
          <Customers />
        </Grid>
        <Grid item xs={12} md={6} lg={4}>
          <Products />
        </Grid>
        <Grid item xs={12} md={6} lg={4}>
          <Order />
        </Grid>
      </Grid>
    </WorkFrame>
  );
}
